import React from 'react';
import '../styles/GameGuide.css';

const GameGuide = () => {
    return (
        <div id="game-guide">
            <div className='wrapper'>
                <h2>как играть онлайн?</h2>
            </div>
        </div>
    );
}

export default GameGuide;
